import todoInfo from "../models/todoItem";
function TodoItem(props : {todoItem: todoInfo}){
    console.log(props.todoItem);

    return(
        <div className="  flex bg-slate-300 m-2 p-2">
            <input type="checkbox" className=" checked:bg-blue-500" checked={props.todoItem.isCompleted}/>
            <div className="flex flex-col m-2">
                <h2>{props.todoItem.title}</h2>
                <p>{props.todoItem.description}</p>
            </div>
        </div>
    )
}
export default TodoItem;
